import React, { Fragment } from 'react';
import { render } from '@testing-library/react';

const NoMatch_404 = () => (
    <Fragment>
        <h1>PAGE NOT FOUND</h1>
        <h1>404</h1>
    </Fragment>
);

export default NoMatch_404;
